I did some improvements and kinda nailed the task. The #rustlang discord community helped me. I learned from them a couple of things: I should await the tasks, so that the program will wait for them to complete. In order for them not to block the main thread, I should spawn the tasks, and await the futures returned by the tasks somewhere else. Any code that will run in the main thread should run in between. I could also use join!, but that's overkill because it's used for lazy futures, and tokio starts the tasks immediately. Therefore awaiting them in series is enough and idiomatic. I didn't understand when to use join! exactly, but I understand what's going on with my code. Here is what I did with what I've learnt: use tokio::sync::{mpsc, oneshot};
use tokio::time::{self, Duration, Instant}; #[tokio::main]
async fn main() { println!("Let's go!"); let (tx, rx) = mpsc::channel(8); let client = tokio::spawn(run_client(tx)); let server = tokio::spawn(run_server(rx)); client.await.unwrap(); server.await.unwrap(); // The main thread will not return until server returns. } Receiving responses: I wanted the clients to be able to send requests and receive responses to those. I accidentally asked GPT to tell me how receive responses from the server so it recommended me to use oneshot channels. So I created a ClientRequest to be sent. #[derive(Debug)]
struct ClientRequest { message: String, tx: oneshot::Sender<String>,
} The server: Ice cream melts. I added this to see how data processing within the server could be a part of the whole message exchanging program. I had seen the interval.tick before, but Copilot completed the piece of code that ticks the timer. I will learn about how that works. async fn run_server(mut rx: mpsc::Receiver<ClientRequest>) { println!("SERVER; I will give one person some ice cream!"); let mut ice_cream_amount = 50; let mut interval = time::interval_at( Instant::now() + Duration::from_secs(1), time::Duration::from_secs(1), ); loop { tokio::select! { _ = interval.tick() => { if ice_cream_amount < 10 { println!("SERVER; no more ice cream!"); return; } ice_cream_amount -= 10; } Some(ClientRequest { message, tx }) = rx.recv() => { println!("SERVER; received: {:?}", message); let response = format!("Here is your ice cream! I have {ice_cream_amount} left!"); tx.send(response).unwrap(); } else => { println!("SERVER; I don't know what's happening here!"); break; } } }
} Client: Every two seconds, the client will ask the server for ice cream, and report how much ice cream is left. It creates a oneshot channel and passes it to the server for an answer. It is blocked until the server responds. async fn run_client(tx: mpsc::Sender<ClientRequest>) { loop { tokio::time::sleep(tokio::time::Duration::from_secs(2)).await; if tx.is_closed() { println!("CLIENT; Ice cream guy is gone! I guess I will go home now."); return; } let (response_tx, response_rx) = oneshot::channel(); let new_msg = ClientRequest { message: String::from("Hello ice cream guy, give me ice cream!"), tx: response_tx, }; tx.send(new_msg) .await .expect("can not send user on channel"); let answer = response_rx.await.unwrap(); println!("CLIENT; I knew you loved me!: {:?}", answer); }
} I might work on a more complicated implementation by adding the following: There are more than one clients, and each time the clients ask for ice cream, the amount of ice cream decreases. The client's are not blocked when they are waiting for a response from the server. Another insight I gained due to the help of a Rust developer was that the Go idiom I mentioned was more than a best practice in Rust. The compiler has strict constraints on how data can be modified by different threads.

