} impl Query { // used by the server pub fn execute(mut self, database: &Database) { let result = (self.f)(database); let _ = self.tx.send(result); } // used by the client pub fn new<F>(f: F) -> (Self, oneshot::Receiver<Box<dyn Any + Send>>) where F: FnMut(&Database) -> Box<dyn Any + Send> + Send + 'static, { let (tx, rx) = oneshot::channel(); let f = Box::new(f); let query = Self { tx, f }; (query, rx) }
} My first approach was to have the one-shot channel and closure that is sent as fields of the query. This felt natural and intuitive. The client creates a Query using the new constructor, boxes the closure to store it and returns the query as well as the one-shot channel for the response. The role of the server is to execute the given closure. The execute method is also responsible for sending the result back to the client, so the server is completely blind to the inner workings of the query or the client. But this created an indirect and verbose implementation. I could implement the server as I expected: But the client side didn't go as expected. It worked, but it was not simple at all. let f: Box<dyn FnMut(&Database) -> Box<dyn Any + Send> + Send> = Box::new(move |database: &crate::server::Database| { Box::new(database.flavor_recipes.contains_key(&Flavor::Chocolate)) });
let (new_msg, response_rx) = Query::new(f);
