I was very surprised and excited at the solution. pub struct Query { execute_and_send: Box<dyn FnOnce(&Database) + Send>,
} /// [Query::new] constructor needs to take a closure of type [FnOnce(&Database) -> T + Send + 'static]
/// it should return a receiver as well as the query object
impl Query { // used by the client pub fn new<T, F>(f: F) -> (Self, oneshot::Receiver<T>) where F: FnOnce(&Database) -> T + Send + 'static, T: Debug + Send + 'static, { let (tx, rx) = oneshot::channel(); let execute_and_send = Box::new(move |database: &Database| { let result = f(database); let _ = tx.send(result); }); let query = Self { execute_and_send }; (query, rx) } // used by the server pub fn execute(self, database: &Database) { (self.execute_and_send)(database); }
} The query constructor takes a closure and wraps it into another closure. The latter executes the former, sends the result through the channel and returns nothing. This way, we can avoid using any generic types or trait objects in the Query struct. This is a very flexible and clear design! Now both the client and server codes are much simpler. Client: let (q, response_rx) = Query::new(|database: &Database| database.flavor_recipes.contains_key(&Flavor::Chocolate)); tx.send(q).await.expect("CLIENT; can not send on channel"); match response_rx.await { Ok(value) => println!( "CLIENT; I asked if he has chocolate flavor! He said {}", value ), Err(e) => println!("CLIENT; failed to receive response: {:?}", e), } Server: //...
Some(query) = rx.recv() => query.execute(&mut database),
//... I think this is a very elegant solution. I don't find it very intuitive yet, it feels like bending my head and looking at the world upside down, but I find the challenge of digesting this exciting.

